import React from 'react';
import './Header.css';
import { Link } from 'react-router-dom';
import Logo from '../../assets/imagens/logo.png'; // Substitua com o caminho correto da sua logo

function Header() {
  return (
    <header className="header">
      <div className="logo">
        <a href="#home">
          <img src={Logo} alt="Logo do Meu Portfólio" />
        </a>
      </div>
      
      <nav className="navbar">
        <ul className="nav-links">
          <li><a href="#about">Sobre</a> {/* O link usa o ID da seção */}
  <a href="#projects">Projetos</a>
  <a href="#contact">Contato</a></li>
          <li></li>
          <li><a href="#contact" className="nav-item">Contato</a></li>
        </ul>
      </nav>
      
      <div className="cta-button">
        <a href="#contact" className="button">Baixar CV</a>
      </div>
    </header>
  );
}


export default Header;
